import React from 'react';
import { Row } from 'react-bootstrap';
import { connect } from 'react-redux';

const PageCallToUs = () => {
    return (
        <>
            <Row>
                <Col>
                    <div>pageCallToUs</div>
                </Col>
            </Row>
        </>
    );
};

export default connect(null, null)(PageCallToUs);
